import React from 'react';
import ReactDOM from 'react-dom';

const fname = "saurav"; 
const lname = "chauhan";

ReactDOM.render(
<>
  <h1>{`My name is ${fname} ${lname}`}  </h1>
  <p>hdb {5*5}</p>
  <ol>
  <li>abc</li>
  <li>def</li>
  <li>ghi</li>
  <li>jkl</li>
  <li>mno</li>
  </ol>
</>, 
  document.getElementById("root")
);
